import React from 'react';

function Card(props) {
  return (
    <div>
      <h2>{props.item.title}</h2>
      <p>{props.item.content}</p>
      {props.item.links.map((link) => {
        return <a href={link}>link</a>
      })}
    </div>
  );
}
export default Card;
